description:
National Geographic - Inside 9-11 - In Multiple Parts
ripped from the 10th Year Commemorative Edition DVD

Osama bin Laden: Dead or Alive

Closely examines the hunt for the mastermind of the 9-11 Planes attack during and after the US war in Afghanistan. Although it briefly covers his death at the hands of Seal Team Six, as it was originally filmed prior to May 2011, this is the story of the earlier hunt in Tora Bora and afterwards.

